apiVersion: operators.coreos.com/v1alpha1
kind: ClusterServiceVersion
metadata:
  annotations:
    alm-examples: '[]'
    capabilities: Basic Install
    categories: Integration & Delivery
    containerImage: The repository that hosts the operator image. The format should match ${REGISTRYHOST}/${USERNAME}/${NAME}:${TAG}
    createdAt: '2020-02-17 01:00:00'
    support: 'I'
    repository: (Optional) a URL to a source code repository of the Operator, intended for community Operators to direct users where to file issues / bug
    description: My first Operator ....
  name: podset-operator.v0.0.1
  namespace: placeholder
spec:
  apiservicedefinitions: {}
  displayName: Podset Operator
  description: Placeholder description
  customresourcedefinitions:
    owned:
    - description: PodSet is the Schema for the podsets API
      kind: PodSet
      name: podsets.app.example.com
      version: v1alpha1
      displayName: Podset Operator22
      description: My first Operator22 ....
  icon: 
    - base64data:  data:image/png;base64,
      mediatype: image/png
  provider:
    name: Gan
  install:
    spec:
      deployments:
      - name: podset-operator
        spec:
          replicas: 1
          selector:
            matchLabels:
              name: podset-operator
          strategy: {}
          template:
            metadata:
              labels:
                name: podset-operator
            spec:
              containers:
              - command:
                - podset-operator
                env:
                - name: WATCH_NAMESPACE
                  valueFrom:
                    fieldRef:
                      fieldPath: metadata.annotations['olm.targetNamespaces']
                - name: POD_NAME
                  valueFrom:
                    fieldRef:
                      fieldPath: metadata.name
                - name: OPERATOR_NAME
                  value: podset-operator
                image: gandhicloud/podset-operator
                imagePullPolicy: Always
                name: podset-operator
                resources: {}
              serviceAccountName: podset-operator
      permissions:
      - rules:
        - apiGroups:
          - ""
          resources:
          - pods
          - services
          - services/finalizers
          - endpoints
          - persistentvolumeclaims
          - events
          - configmaps
          - secrets
          verbs:
          - create
          - delete
          - get
          - list
          - patch
          - update
          - watch
        - apiGroups:
          - apps
          resources:
          - deployments
          - daemonsets
          - replicasets
          - statefulsets
          verbs:
          - create
          - delete
          - get
          - list
          - patch
          - update
          - watch
        - apiGroups:
          - monitoring.coreos.com
          resources:
          - servicemonitors
          verbs:
          - get
          - create
        - apiGroups:
          - apps
          resourceNames:
          - podset-operator
          resources:
          - deployments/finalizers
          verbs:
          - update
        - apiGroups:
          - ""
          resources:
          - pods
          verbs:
          - get
        - apiGroups:
          - apps
          resources:
          - replicasets
          - deployments
          verbs:
          - get
        - apiGroups:
          - app.example.com
          resources:
          - '*'
          verbs:
          - create
          - delete
          - get
          - list
          - patch
          - update
          - watch
        serviceAccountName: podset-operator
    strategy: deployment
  installModes:
  - supported: true
    type: OwnNamespace
  - supported: true
    type: SingleNamespace
  - supported: false
    type: MultiNamespace
  - supported: true
    type: AllNamespaces
  maturity: alpha
  replaces: podset-operator.v0.0.0
  version: 0.0.1
